import React from 'react'


export default class Options extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
             checked : 'false'
        }
    }

    handleCheck(){
        this.setState({ checked: 'true' });
    }
    
    render() {
        return (
            <div>
                <p>
                    {<input type="checkbox" onChange={this.handleCheck} />}
                    First
            </p>
                <p>
                    {<input type="checkbox" onChange={this.handleCheck} />}
                    Second
            </p>
                <p>
                    {<input type="checkbox" onChange={this.handleCheck} />}
                    Third
            </p>
                <p>
                    {<input type="checkbox" onChange={this.handleCheck} />}
                    Fourth
            </p>
            </div>
        );
    }
}

